import React, { useEffect, useState } from 'react'
import classes from './Feed.module.css'
import {SidePar} from './index'
import {FetchFromApi} from './Fetching/FetchFromApi'
function Feed() {
    const [choosen , setChossen] = useState('')
    useEffect(()=>{
        FetchFromApi('search')
    }, [])

    
    const getData = (value) => {
        setChossen(value)
    }
    console.log(choosen)
    // FetchFromApi('search')
    return (
        <div className={classes.content}>
            <SidePar onsend={getData} />
            <h1>New <span>Vidios</span> </h1>
        </div>
    )
}

export default Feed
